INSERT INTO `comunicaciones_blog_comentarios` VALUES ('42', '0', '130', '3267', 'KATIA CELESTE ZUNO RAMIREZ', '2012-09-09', 'Socio utiliza noche en cortesía ó \"Fin de Semana En  Cortesía.\"    --Leer blog--', '09:20:38');
INSERT INTO `comunicaciones_blog_comentarios` VALUES ('43', '0', '130', '3267', 'KATIA CELESTE ZUNO RAMIREZ', '2012-09-09', 'El Sr. Alday, al principio de la venta se le ofreció una membresía black mencionandosele que tenia derecho a 2 semanas y 2 noches en cortesía; sin embargo al momento de la venta su activación fue con una GOLD, mas nunca se confirmó que sus nuevos beneficios eran solo 1 noche en cortesía y 1 DVW, por lo que el pax desde hace aprox 1 semana ha estado solicitando y pidiendo que se le confirme lo que a él se le vencio: \"Su fin de semana gratis\" ó 2 noches en cortesía, por lo cual después de envíos de presupuestos y/o disponibilidad en hoteles que entren en convenio, el pax decididamente los ha rechazado.\rEl socio requería ciertos hoteles en específico, sin embargo se ha informado por medio de su carta de bienvenida que en caso de él RESERVAR un hotel que solicita ESPECIFICAMENTE, se procederá a cobrar la dif de tarifa, la cual rechaza.\rDespués de varios presupuestos, el pax finalmente reserva el Hotel Casa Blanca en México (Rva 38295760), por 2 noches sin cargo para él. Pagándose1 noche en cortesía en MKT Travel y la diferencia por parte de la Oficina de Chiapas, en la cual se cometió el incidente.', '10:01:05');
